import React, { ButtonHTMLAttributes } from 'react';
import '../../assets/style/global.css';
import './style.css';

interface ButtonVermaisProps extends ButtonHTMLAttributes<HTMLButtonElement> {
    value: string;
}

const ButtonVermais: React.FC<ButtonVermaisProps> = ({ value }) => {
    return (
        <div>
            <button className="ButtonArea1">{value}</button>
        </div>
    );
}

export default ButtonVermais;
